import { useSelector } from 'react-redux';
import { CityItem } from './CityItem';

export const SearchedList = () => {
  const list = useSelector((state) => state.reducer.searchedCities);
  return (
    <div className="container">
      {list.map((i) => {
        return (
          <CityItem
            name={i.name}
            description={i.description}
            temp={i.temp}
            wind={i.wind}
            humidity={i.humidity}
            key={Math.random() * 100}
          />
        );
      })}
    </div>
  );
};
